import React from "react";
import {Router, Route, Link, Routes, createBrowserRouter, createRoutesFromElements } from "react-router-dom";
import Signin from "./components/Signin/Signin";
import "./App.css";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
            <Route path="/" element={<Signin />} />
        </Routes>
      </BrowserRouter>
    </div>
  )
 }

export default App;
